  Data(
      {int? currentPage,
      List<DataInSideFavorites>? dataInSideFavorites,
      String? firstPageUrl,
      int? from,
      int? lastPage,
      String? lastPageUrl,
      dynamic nextPageUrl,
      String? path,
      int? perPage,
      dynamic prevPageUrl,
      int? to,
      int? total}) {
    _currentPage = currentPage;
    _dataInSideFavorites = dataInSideFavorites;
    _firstPageUrl = firstPageUrl;
    _from = from;
